var ModalModule = (function(){
function initialize(){
    var clean = function(){
        var bg=$('.mfp-bg')
        if(bg) bg.remove();
        var wrap=$('.mfp-wrap')
        if(wrap) wrap.remove();
    }

    function blurIn() {
        $('.container').attr("aria-hidden", "true");
    }

    function blurOut() {
        $('.container').removeAttr("aria-hidden");

    }

    function setCloseButtonListener(){
        $(".mfp-close").on("click touch", function(){
            $.magnificPopup.close();
        });

    }

    function contentStopPropagation() {
        $('.mfp-content').click(function( event ) {
            if(event.target.className != "mfp-close") {
                event.stopPropagation();
            }
        });
    }

    /* This function runs the cookiebot scripts on
       panel pages which is required to load the iframes
       which are dependent on consent
    */
    function runCookiebotScripts() {
        if(typeof Cookiebot != "undefined") {
            Cookiebot.runScripts();
        }
    }

    var closeMarkup = "<button title='%title%' type=\"button\" class=\"mfp-close si si-close-button\" >\n" +

        "</button>";

    var focusCloseButton = function(){
        $(".mfp-close").focus()
    }


    $('.inverse-panel').magnificPopup({
        type: 'ajax',
        closeOnContentClick: false,
        closeMarkup:closeMarkup,
        closeOnBgClick: true,
        disableOn:1200,
        removalDelay: 300,
        mainClass: 'mfp-slide',
        callbacks: {
            beforeOpen: function() {
                this.st.el.attr('aria-expanded', 'true')
                clean();
            },
            open: function() {
                contentStopPropagation();
            },
            close: function() {
                window.location.hash = "";
                this.st.el.attr('aria-expanded', 'false')
            },
            afterClose: function() {
                this.st.el.siblings('.button-focus-catcher').focus();
            },
            parseAjax: function(mfpResponse) {
                mfpResponse.data = $(mfpResponse.data).find('.content.panel-content');
            },
            ajaxContentAdded: function() {
                var hash = this.currItem.src;
                if(hash.indexOf("#") > -1) {
                    window.location.hash = "#" + hash.split('#')[1];
                }
                setCloseButtonListener();
                focusCloseButton();
                MagnificPopupModule.scaleCloseButton();
                window.numberAnimation('.mfp-slide');
                window.initVisualList('.mfp-content');
                window.initLazy();
            }
        }
    });

    $('.panel').magnificPopup({
        type: 'ajax',
        closeOnContentClick: false,
        closeMarkup:closeMarkup,
        closeOnBgClick: true,
        disableOn:1200,
        removalDelay: 300,
        mainClass: 'mfp-slide legacyStyles',
        callbacks: {
            beforeOpen: function() {
                this.st.el.attr('aria-expanded', 'true')
                clean();
            },
            open: function() {
                contentStopPropagation();
            },
            close: function() {
                window.location.hash = "";
                this.st.el.attr('aria-expanded', 'false')
            },
            afterClose: function() {
                this.st.el.siblings('.button-focus-catcher').focus();
            },
            parseAjax: function(mfpResponse) {
                mfpResponse.data = $(mfpResponse.data).find('.content.panel-content');
            },
            ajaxContentAdded: function() {
                var hash = this.currItem.src;
                if(hash.indexOf("#") > -1) {
                    window.location.hash = "#" + hash.split('#')[1];
                }
                SlickCarousel.initialize();
                /* Disabling AOS as it doesn't have support on panel pages*/
                AOS.init({disable: true});
                /* Runs the cookiebot scripts to load the iframes on panel pages */
                runCookiebotScripts();
                setCloseButtonListener();
                focusCloseButton();
                MagnificPopupModule.scaleCloseButton();
                onloadCallback();
                window.initVisualList('.mfp-content');
            }
        },
    });
    }
    return{
        initialize: initialize
    };
})();
function toggleOverlay() {
    function fadeInOverlay() {
        $('body').addClass("overlay");
        $('.page-overlay').css("display", "block");
        $('.page-overlay').animate({
            opacity: 0.6
        }, 500, function() {
        });
    }

    function fadeOutOverlay() {
        $('body').addClass("overlay-out");
        $('.page-overlay').animate({
            opacity: 0.0
        }, 500, function() {
            $('.page-overlay').css("display", "none");
        });
    }

    if($('body').hasClass("overlay")) {
        $('body').removeClass("overlay");
        fadeOutOverlay();
    } else if ($('body').hasClass("overlay-out")) {
        $('body').removeClass("overlay-out");
        fadeInOverlay();
    } else {
        fadeInOverlay();
    }
}


var SlickCarousel = (function () {
    var $ = window.jQuery;
        function initialize() {
            $(".slideshow").each(function(){

                var time = $(this).data('duration') || 7000;
                $(this).not('.slick-initialized').slick({
                    infinite: false,
                    dots: true,
                    autoplay:true,
                    autoplaySpeed: time,
                    rows: 0,
                    prevArrow: false,
                    nextArrow: false
                });

                $(this).find('.slick-slide').each(function(){
                    var time = 0;
                    var sx = 0;
                    var sy = 0;


                    $(this).on('mousedown touchstart', function(e){
                        time = new Date().getTime();
                        sx = e.screenX;
                        sy = e.screenY;
                    })
                    $(this).on('mouseup touchend', function(e){
                        if(e.originalEvent.button != 0){
                            return
                        }

                        var timedelta = new Date().getTime() - time;
                        var sxd = Math.abs(e.screenX - sx);
                        var syd = Math.abs(e.screenY - sy);

                        if (timedelta < 500 && sxd < 50 && syd < 50){
                            var anchor = $(this).find('a');
                            var link = anchor.attr('href');
                            if(link){
                                window.location.href = link;
                            }
                        }
                    })
                })
            })
        }

        return {
            initialize: initialize
        };
})();
